import React from 'react';
import Head from 'next/head';

const HeadTag = () => {
    return (
        <>
            <Head>
                <script src="/js/jquery-1.9.1.min.js"></script>
                <script src="/js/jquery.easing.js"></script>
                <script src="/js/common.js"></script>
            </Head>
        </>
    )
}

export default HeadTag;
